                <Menu.Item key = "home">노드버드</Menu.Item>
                <Menu.Item key = "profile">프로필</Menu.Item>
                <Menu.Item key = "mail">
                    <Input.Search enterßButton style={{verticalAlign:'middle'}}/>
                </Menu.Item>
            </Menu>
        </div>
    );
};

export default AppLayout;
